  `titulo` varchar(255) NOT NULL,
  `categoria` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1847 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS ` usuarios`;
CREATE TABLE `usuarios` (
